import React from "react";
import "./Home.css";
import Cover from "../../img/bg-soap.png";
//import Tap from "../../img/ic-tap.png";

const Home = () => {
  return (
    <div className="Home">
      <div className="img">
        <img src={Cover} alt="" />
      </div>
    </div>
  );
};

export default Home;
